import React from "react";
import Photo1 from "./img/WhatsApp Image 2024-04-16 at 08.50.18_0a73cd96.jpg"
const Start = () => {
  return (
    <>

      <div className=" bg-gray-800 flex flex-col justify-center items-center w-auto h-[100vh] text-4xl">
      <div>
      <img src={Photo1} width={40} />
        
      </div>

        <div className="flex">
          <button
            onClick={() => console.log("User clicked")}
            className="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 group-hover:from-cyan-500 group-hover:to-blue-500 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800"
          >
            <span className="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0 text-lg">
              User
            </span>
          </button>
          <button
            onClick={() => console.log("Manager clicked")}
            className="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 group-hover:from-cyan-500 group-hover:to-blue-500 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800"
          >
            <span className="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0 text-lg">
              Manager
            </span>
          </button>
        </div>
      </div>
    </>
  );
};

export default Start;
